import React from "react";
import { ReactComponent as Coachside } from "./images/coachRear.png";
import { ReactComponent as Coachrear } from "./images/coachSide.png";
import { ReactComponent as Cruise } from "./images/cruise.png";
import { ReactComponent as Sunset } from "./images/sunset.png";

const Dashboard = () => {
	return (
		<>
			<h1>Tour Dashboard</h1>
			<div className="dashboardImage">
				{/*Images imported as React component*/}
				<Coachside className="dashboardImage" />
			</div>
			<div className="dashboardImage">
				{/*Images imported as React component*/}
				<Coachrear className="dashboardImage" />
			</div>
			<div className="dashboardImage">
				{/*Images imported as React component*/}
				<Cruise className="dashboardImage" />
			</div>
			<div className="dashboardImage">
				{/*Images imported as React component*/}
				<Sunset className="dashboardImage" />
			</div>
			<button>Check-In</button>
			<button>Your Tour</button>
			<button>Weather</button>
			<button>Contact Us</button>
		</>
	);
};

export default Dashboard;
